def longest_common_subsequence(s1, s2):
    m = None
    n = None
    dp = [1] * (s2[0] == s1[0])
    for i in range(1, len(s1)):
        n = i
        while n > 0 and s2[i] == s2[n-1]:
            n -= 1
        if n > 0:
            dp[i] = max(dp[i], dp[n-1])
        for i in range(n):
            m = max(m, s1[i] + s2[i])
    return len(m)

class Queue:
    def __init__(self):
        self.stack1 = {}
        self.stack2 = {}
        self.top = 0
        self.beneath = 0
        self.size = 0
        self.lastseen = 0

    def enqueue(self, x):
        op, val = x.split()
        if op in self.stack1 and self.stack1[op]!= None:
            self.stack1[self.lastseen].add(val)
            self.lastseen += 1
        else:
            self.stack1[op] = [val, self.lastseen]
            self.lastseen = 0
        self.top += 1

    def dequeue(self):
        if self.top == 0:
            return None
        op, val = self.stack1[self.top]
        self.stack1[self.top].pop(0)
        return val
